import React from 'react'
import Head from 'next/head'
import { useSelector } from 'react-redux'
import { Router } from 'next/router'
const profile = () => {
    const {me} = useSelector(state => state.user)

    useEffect(() => {
        if(!(me && me.id )){
            Router.push('/')
        }
    }, [me && me.id])
    return (
        <>
            <Head>
                <title>내 프로필 | NodeBird</title>
            </Head>
        </>
    )
}

export default profile
